import React from 'react';
import MovieBlock from './MovieBlock';

export default function MovieList( { movies } ) {
  return (
    <div>
      {movies.map(movie => (
        <MovieBlock
          key={movie.imdbID}
          title={movie.Title}
          posterUrl={movie.Poster}
          />
      ))}
    </div>
  )
}
